import React from "react";
import "./style.css";
import API from "../utils/API"

function Card(){

    findResident = () => {
        API.search()
          .then(res => this.setState({ result: res.data }))
          .catch(err => console.log(err));
      };

    return (
    <div className="resident">
        {API.search()}
        </div>
        )
}

export default Card;
